import React from "react";
import styles from "../components/styles.css";


function App(props) {
  return (
    <div>

      <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img className="circle-img" src={props.image} alt="avatar_img"/>
        </div>
        <div className="bottom"> 
          <p className="info">{props.phone}</p>
          <p>{props.email}+</p>
        </div>
      </div>
    </div>
  );
}

export default App;
